/*
DROP TABLE "PAYMENT_DETAILS" cascade constraints;
DROP TABLE "PAYMENTS" cascade constraints;
DROP TABLE "WAREHOUSE_IMPORTS" cascade constraints;
DROP TABLE "WAREHOUSE_MANAGES" cascade constraints;
DROP TABLE "EMPLOYEES" cascade constraints;
DROP TABLE "CUSTOMERS" cascade constraints;
DROP TABLE "CARS" cascade constraints;
DROP TABLE "OFFICES" cascade constraints;
*/
/*
SELECT * FROM OFFICES;
SELECT * FROM CARS;
SELECT * FROM CUSTOMERS;
SELECT * FROM EMPLOYEES;
SELECT * FROM PAYMENTS;
SELECT * FROM PAYMENT_DETAILS;
SELECT * FROM WAREHOUSE_MANAGES;
SELECT * FROM WAREHOUSE_IMPORTS;
*/

  CREATE TABLE "OFFICES" 
   (	
    "OFFICEID" VARCHAR2(10), 
	"CITY" VARCHAR2(200), 
	"HOTLINE" VARCHAR2(50),
	CONSTRAINT "OFFICES_PK" PRIMARY KEY ("OFFICEID")
   );

  CREATE TABLE "CARS" 
   (	
    "CARID" VARCHAR2(10), 
	"CARNAME" VARCHAR2(50), 
	"VENDOR" VARCHAR2(50), 
	"PRICE" NUMBER,
	CONSTRAINT "CARS_PK" PRIMARY KEY ("CARID")
   );

  CREATE TABLE "CUSTOMERS" 
   (	
    "CUSID" VARCHAR2(10), 
	"CUSNAME" VARCHAR2(50), 
	"CUSGENDER" VARCHAR2(50), 
	"CUSBIRTH" DATE, 
	"CUSPHONE" VARCHAR2(50), 
	"CUSADDRESS" VARCHAR2(50),
	CONSTRAINT "CUSTOMERS_PK" PRIMARY KEY ("CUSID")
   );

  CREATE TABLE "EMPLOYEES" 
   (	
    "EMPID" VARCHAR2(10), 
	"OFFICEID" VARCHAR2(10), 
	"EMPNAME" VARCHAR2(50), 
	"EMPGENDER" VARCHAR2(50), 
	"EMPBIRTH" DATE, 
	"EMPADDRESS" VARCHAR2(50), 
	"EMPPHONE" VARCHAR2(50), 
	"EMPSALARY" NUMBER,
	CONSTRAINT "EMPLOYEES_PK" PRIMARY KEY ("EMPID"),
	CONSTRAINT "EMPLOYEES_FK" FOREIGN KEY ("OFFICEID") REFERENCES "OFFICES" ("OFFICEID")
   );

  CREATE TABLE "PAYMENTS" 
   (	
    "PAYMENTID" VARCHAR2(10), 
	"CUSID" VARCHAR2(10), 
    	"EMPID" VARCHAR2(10), 
	"PAYMENTDATE" DATE, 
	"TOTALPRICE" NUMBER,
	CONSTRAINT "PAYMENTS_PK" PRIMARY KEY ("PAYMENTID"),
	CONSTRAINT "PAYMENTS_FK" FOREIGN KEY ("CUSID") REFERENCES "CUSTOMERS" ("CUSID"),
	CONSTRAINT "PAYMENTS_FK_2" FOREIGN KEY ("EMPID") REFERENCES "EMPLOYEES" ("EMPID")
   );

  CREATE TABLE "PAYMENT_DETAILS" 
   (	
    "PAYMENTID" VARCHAR2(10), 
	"CARID" VARCHAR2(10), 
	"EXPORTQUANTITY" NUMBER, 
	"PRICEDETAIL" NUMBER,
	CONSTRAINT "PAYMENT_DETAILS_PK" PRIMARY KEY ("PAYMENTID", "CARID"),
    CONSTRAINT "PAYMENT_DETAILS_FK_1" FOREIGN KEY ("PAYMENTID") REFERENCES "PAYMENTS" ("PAYMENTID"),
	CONSTRAINT "PAYMENT_DETAILS_FK_2" FOREIGN KEY ("CARID") REFERENCES "CARS" ("CARID")
   );

  CREATE TABLE "WAREHOUSE_IMPORTS" 
   (	
    "OFFICEID" VARCHAR2(10), 
	"CARID" VARCHAR2(10), 
	"IMPORTDATE" DATE, 
	"IMPORTQUANTITY" NUMBER,
	CONSTRAINT "WH_IMPORTS_PK" PRIMARY KEY ("OFFICEID", "CARID", "IMPORTDATE"),
    CONSTRAINT "WH_IMPORTS_FK_1" FOREIGN KEY ("OFFICEID") REFERENCES "OFFICES" ("OFFICEID"),
    CONSTRAINT "WH_IMPORTS_FK_2" FOREIGN KEY ("CARID") REFERENCES "CARS" ("CARID")
   );

  CREATE TABLE "WAREHOUSE_MANAGES" 
   (	
    "OFFICEID" VARCHAR2(10), 
	"CARID" VARCHAR2(10), 
	"QUANTITY" NUMBER,
	CONSTRAINT "WH_MANAGES_PK" PRIMARY KEY ("OFFICEID", "CARID"),
    CONSTRAINT "WH_MANAGES_FK_1" FOREIGN KEY ("OFFICEID") REFERENCES "OFFICES" ("OFFICEID"),
    CONSTRAINT "WH_MANAGES_FK_2" FOREIGN KEY ("CARID") REFERENCES "CARS" ("CARID")
   );

